const FinallAvgGrade = ({grade}) => {
    return (
    <div style={{ display: "flex", flexDirection: "column",justifyContent:"center" }}>
              <div
                style={{
                  borderRadius: "90px",
                  color: "white",
                  background: "#7A55B5",
                  width: "fit-content",
                  padding: "10px",
                }}
              >
                {grade}
              </div>
            </div>
    );
}

export default FinallAvgGrade;
